  <script type="text/javascript">(function (diagram) { 
$(document).ready(function() {

    diagram.showSidebar(true, 0);

    function update(e) {
        var lift = $(this).data('lift');
        var checked = $(this).prop('checked');
        d3.selectAll(lift).classed("lift-on", checked);
        d3.selectAll(lift).classed("lift-off", !checked);
    };

    setTimeout(function() {
        $('#starting').hide();
        $('[data-lift]').each(update).change(update);
    }, 1000);
    
});
